function() {
	game.util.newLife = function (
		isPlayer,
		level,
		species,
		faction,
		bodies,
		brains,
		masks,
		weapons,
		backWeapons,
		dummyObject
	) {
		const life = new ABE.LifeObject(false, { isPlayer: isPlayer || false });

		/*Make useable and blank, give random stats*/
		life.setBlank();
		life.randomizeStats(level);

		/*Set faction*/
		life.data.faction = faction || "nomad";

		if (!dummyObject) {
			/*Add to layers and servers*/
			game.render.lifeLayer.addChild(life);
			game.world.addObject(life);
			game.world.addToServer(life);
		}

		let disabledBody = false;
		let disabledBrain = true;
		let disabledMask = false;
		let disabledWeapon = false;
		let disabledBackWeapon = false;

		if (species === "robot") {
			disabledMask = true;
			disabledBody = true;
		}

		if (species === "animal") {
			disabledMask = true;
			disabledBody = true;
		}

		if (species === "lokal") {
			disabledMask = true;
		}

		/*Add armors, loot and weapons*/
		try {
			if (brains) {
				life.inventory.brain.addItem(
					new ABE.InventoryItem(brains[game.rng(0, brains.length - 1)], {
						disabled: disabledBrain,
					}),
					true
				);
			}
			if (bodies) {
				life.inventory.body.addItem(
					new ABE.InventoryItem(bodies[game.rng(0, bodies.length - 1)], {
						disabled: disabledBody,
					}),
					true
				);
			}
			if (masks) {
				life.inventory.mask.addItem(
					new ABE.InventoryItem(masks[game.rng(0, masks.length - 1)], {
						disabled: disabledMask,
					}),
					true
				);
			}
			if (weapons) {
				life.inventory.weapon.addItemNow(
					new ABE.InventoryItem(weapons[game.rng(0, weapons.length - 1)], {
						disabled: disabledWeapon,
					}),
					true
				);
			}
			if (backWeapons) {
				life.inventory.backWeapon.addItemNow(
					new ABE.InventoryItem(
						backWeapons[game.rng(0, backWeapons.length - 1)],
						{ disabled: disabledBackWeapon }
					),
					true
				);
			}
		} catch (e) {
			console.error(e);
		}

		if (!dummyObject) {
			/*Sync changes to server*/
			life.sync();
		}

		return life;
	};

}
